import { defineMessages } from 'react-intl';

export const scope = 'app.containers.WorkshopInfo';

export default defineMessages({
  workshop: {
    id: `${scope}.workshop`,
    defaultMessage: 'Workshop',
  },
  workshopDetails: {
    id: `${scope}.workshopDetails`,
    defaultMessage: 'Workshop Details',
  },
  locationDetails: {
    id: `${scope}.locationDetails`,
    defaultMessage: 'Location Details',
  },
  contactDetails: {
    id: `${scope}.contactDetails`,
    defaultMessage: 'Contact Details',
  },
  paymentDetails: {
    id: `${scope}.paymentDetails`,
    defaultMessage: 'Payment Details',
  },
  workshopImages: {
    id: `${scope}.workshopImages`,
    defaultMessage: 'Workshop Images',
  },
  galleryRequired: {
    id: `${scope}.galleryRequired`,
    defaultMessage: 'Gallery is required',
  },
  dragAndDropMessage: {
    id: `${scope}.dragAndDropMessage`,
    defaultMessage: 'Drag and drop a file here, or click to select file.',
  },
  dropFilesHere: {
    id: `${scope}.dropFilesHere`,
    defaultMessage: 'Drop your files here...',
  },
  saveButtonLabel: {
    id: `${scope}.saveButtonLabel`,
    defaultMessage: 'Save',
  },
  cancelButtonLabe: {
    id: `${scope}.cancelButtonLabe`,
    defaultMessage: 'Clear',
  },
  bulkUpload: {
    id: `${scope}.bulkUpload`,
    defaultMessage: 'Bulk Upload',
  },
  somethingWentWrong: {
    id: `${scope}.somethingWentWrong`,
    defaultMessage: 'Something went wrong while saving Workshop Details.',
  },
  workshopDetailsSaveSuccess: {
    id: `${scope}.workshopDetailsSaveSuccess`,
    defaultMessage: 'Workshop Details was saved successfully.',
  },
});
